import React from 'react'

import Background from '../components/Background'
import Header from '../components/Header'

const styles = {
    container: {
        width: '100vw',
        height: '150vh',
        position: 'relative',
        backgroundColor: '#eee'
    },
    row: {
        display: 'flex'
    }
}

const Index = () => (
    <section style = { styles.container }>
        <div style = { styles.row }>
            <Background />
            <Header />
        </div>
    </section>
)

export default Index
